import React from 'react';
import './Notes.css';


const Notes = ({notetitle}) => {
   
    console.log("This is Notes->"+notetitle);


  return (
    <div className='notes'>
      {<div className="note">
           <h2>{notetitle}</h2>
        </div>}
    </div>
  )
}

export default Notes
